description:
Ted Jackson (Presley) is a former Navy frogman who divides his time between twin careers as a deep sea diver and nightclub singer. Ted discovers what he believes could be a fortune in Spanish gold aboard a sunken ship and sets out to rescue it with the help of go-go dancing yoga expert Jo Symington (Dodie Marshall). However, Gil Carey (Skip Ward) is also after the treasure and uses his girlfriend Dina Bishop (Pat Priest) to foil Ted's plans. Elvis sings six tunes in this picture, including the deathless &quot;Yoga Is as Yoga Does&quot; and &quot;The Love Machine.&quot;

PAL,region 2.

